  false,\n\t\"url\": null,\n\t\"notes\": \"This data layer provides access to Incidents
  of National Significance as part of the CIMC web service. Incidents of National
  Significance include all Presidentially-declared emergencies, major disasters, and
  catastrophes. Multiple federal departments and agencies, including EPA, coordinate
  actions to help prevent, prepare for, respond to, and recover from Incidents of
  National Significance. The Incidents of National Significance shown in this web
  service are derived from the epa.gov website and include links to the relevant web
  pages within the attribute table. Data about Incidents of National Significance
  are located on their own EPA web pages, and CIMC links to those pages. The CIMC
  web service was initially published in 2013, but the data are updated on the 18th
  of each month. The full schedule for data updates in CIMC is located here: https://iaspub.epa.gov/enviro/data_update_v2.\",\n\t\"license_title\":
